name: SF32LB52 Series
variants:
- name: SF32LB52
  cores:
  - name: main
    type: armv8m
    core_access_options: !Arm
      ap: !v1 0
  memory_map:
  - !Nvm
    range:
      start: 0x12000000
      end: 0x1FFFFFFF
    cores:
    - main
  - !Ram
    name: DTCM
    range:
      start: 0x20000000
      end: 0x2001FFFF
    cores:
    - main
    access:
      boot: true
  - !Ram
    name: SRAM
    range:
      start: 0x20020000
      end: 0x2007FFFF
    cores:
    - main
    access:
      boot: true
  flash_algorithms:
  - sf32lb52x
flash_algorithms:
- name: sf32lb52x
  description: SF32LB52X UNI_FLASH
  default: true
  instructions: 
  pc_init: 0x515
  pc_uninit: 0x6f1
  pc_program_page: 0x7a1
  pc_erase_sector: 0x6f5
  data_section_offset: 0xb408
  flash_properties:
    address_range:
      start: 0x10000000
      end: 0x70000000
    page_size: 0x2000
    erased_byte_value: 0xff
    program_page_timeout: 6000
    erase_sector_timeout: 3000
    sectors:
    - size: 0x10000
      address: 0x0
  cores:
  - main
